//--- CreateRectangleHitboxY --- DONE
int* CreateRectangleHitboxY(int Y, int r1, int r2)
{
	int size = (r1*4+2)+(r2*4+2)-4;
	int *tab = (int*)malloc(size*sizeof(int));

	int i=0;
	int j1=r1;
	int j2=r2;

	for(; i<r1*2+1; i++)
		tab[i]=Y+r2;
	while(j2!=0)
	{
    j2--;
    tab[i]=Y+j2;
		i++;
	}
	while(j2!=r2)
	{
		j2++;
    tab[i]=Y-j2;
		i++;
	}
	for(; i<r1*2+1+r2*2+r1*2; i++)
		tab[i]=Y-r2;
	while(j2!=0)
	{
    j2--;
    tab[i]=Y-j2;
    i++;
	}
	while(j2!=r2)
	{
		j2++;
    tab[i]=Y+j2;
		i++;
	}
	return tab;
}
//--- CreateRectangleHitboxX --- DONE
int* CreateRectangleHitboxX(int X, int r1, int r2)
{
	int size = (r1*4+2)+(r2*4+2)-4;
	int *tab = (int*)malloc(size*sizeof(int));

	int i=0;
	int j1=r1;
	int j2=r2;

	tab[i]=X-j1;

	while(j1!=0)
	{
		i++;
		j1--;
		tab[i]=X-j1;
	}
	while(j1!=r1)
	{
		i++;
		j1++;
		tab[i]=X+j1;
	}
	i++;
	for(; i<r1*2+r2*2+1; i++)
		tab[i]=X+r1;
  while(j1!=0)
	{
		j1--;
    tab[i]=X+j1;
    i++;
	}
	while(j1!=r1)
	{
		j1++;
    tab[i]=X-j1;
		i++;
	}
  for(; i<r1*4+r2*4; i++)
		tab[i]=X-r1;

  return tab;
}
