//--- RunGame --- DONE
void RunGame()
{
	map = ChooseMap();

	if(map==1) ReadMap(1);
	else if(map==2) ReadMap(2);
	else if(map==3) ReadMap(3);
	else if(map==4) ReadMap(4);
	else if(map==5) ReadMap(5);

	int time = 0;

	SetUI(3,0,0,1);

	s1.Y = 155;
	s1.X = 145;
	s1.HP = 3;
	s1.centerHeight = 23;
	s1.centerWidth = 13;
	s1.speed = 300;

	DMG.borderDMG = 3;
	DMG.snowmanDMG = 1;
    DMG.rockDMG = 3;
    DMG.bowmanDMG = 2;
    DMG.treeDMG = 2;

	DrawSkier(1, s1.X, s1.Y);

	int leftBorderHitboxX[192];
	int leftBorderHitboxY[192];
	int rightBorderHitboxX[192];
	int rightBorderHitboxY[192];
	int metaHitboxX[320];
	int metaHitboxY[320];
	int leftBorderFlag = 0;
	int rightBorderFlag = 0;

	int* objectBorderHitboxX;
	int* objectBorderHitboxY;
	int objectR1 = 0;
	int objectR2 = 0;

	int position = 0;
	int arrow = 0;
	HAL_Delay(200);
	PressStartButton();
	HAL_Delay(200);

	int step=0;
	int smallStep=0;

	while(1)
	{
		ILI9341_Fill_Rect(0,20,320,211,65535);
		s1.Hitbox_Y = CreateRectangleHitboxY(position+5+s1.centerHeight,s1.centerWidth,s1.centerHeight);
		s1.Hitbox_X = CreateRectangleHitboxX(s1.X+s1.centerWidth,s1.centerWidth,s1.centerHeight);
		UpdateSpeedValue(s1.speed);
		PressPauseButton();

        if(position%12==0)
        {
        	step++;
        	smallStep = 0;
        }
        for(int i=step, a=15; i<18+step; i++, a--)
        {
            leftBorderFlag = 0;
		    rightBorderFlag = 0;

            for(int j=0; j<40; j++)
            {
                if(i<125 && j<40 && m1.leftBorder[i][j]=='1')
                {
                    for(int k=0; k<12; k++)
                    {
                        if(31+(a*12)-k+smallStep < 212 && 31+(a*12)-k+smallStep > 19)
                        {
                            ILI9341_DrawPixel(290-j, 31+(a*12)-k+smallStep, 51071);
                            ILI9341_DrawPixel(291-j, 31+(a*12)-k+smallStep, 51071);
                            ILI9341_DrawPixel(292-j, 31+(a*12)-k+smallStep, 51071);
                            if(12*a+k>=0 && 12*a+k<=192)
                            {
                            	leftBorderHitboxX[12*a+k] = 290-j;
                            	leftBorderHitboxY[12*a+k] = 31+(a*12)-k+position;
                            }
                        }
                    }
                    leftBorderFlag = 1;
                }
                if(i<125 && j<40 && m1.rightBorder[i][j]=='1')
                {
                    for(int k=0; k<12; k++)
                    {
                        if(31+(a*12)-k+smallStep < 212 && 31+(a*12)-k+smallStep > 19)
                        {
                            ILI9341_DrawPixel(69-j, 31+(a*12)-k+smallStep, 51071);
                            ILI9341_DrawPixel(70-j, 31+(a*12)-k+smallStep, 51071);
                            ILI9341_DrawPixel(71-j, 31+(a*12)-k+smallStep, 51071);
                            if(12*a+k>0 && 12*a+k<192)
                            {
                            	rightBorderHitboxX[12*a+k] = 70-j;
                            	rightBorderHitboxY[12*a+k] = 31+(a*12)-k+position;
                            }
                        }
                    }
                    rightBorderFlag = 1;
                }
                if((rightBorderFlag==1) && (leftBorderFlag==1))
					break;
            }
        }

        for(int i=step, a=15; i<18+step; i++, a--)
        {
        	for(int j=0; j<11; j++)
        	{
        		if(i<125 && j<11 && m1.obstacles[i][j]=='5')
        		{
        			if(31+(a*12)+smallStep < 212 && 26+(a*12)+smallStep > 19)
        			{
        				ILI9341_Fill_Rect(0,26+(a*12)+smallStep,320,31+(a*12)+smallStep,COLOR_RED);

            			for(int k=0; k<320; k++)
            			{
            				metaHitboxX[k] = k;
            				metaHitboxY[k] = 10+((15-a)*12)+position;
            			}
        			}
        			if(MetaCollision(s1.Hitbox_X, s1.Hitbox_Y, s1.centerHeight, s1.centerWidth, metaHitboxX, metaHitboxY))
        			{
        				Animation();
        				//Sound(3);
        				AddRecord((time/1000)*2, s1.HP);
        				return;
        			}
        			break;
        		}
        		else if(i<125 && j<11 && m1.obstacles[i][j]!='0')
        		{
        			switch(m1.obstacles[i][j])
        			{
        			case '1':
        				objectR1 = 13;
        				objectR2 = 14;
        				objectBorderHitboxX = CreateRectangleHitboxX(30+26*j+14, objectR1, objectR2);
        				objectBorderHitboxY = CreateRectangleHitboxY(((15-a)*12)+position-20, objectR1, objectR2);
        				break;
        			case '2':
        				objectR1 = 11;
        				objectR2 = 11;
        				objectBorderHitboxX = CreateRectangleHitboxX(30+26*j+12, objectR1, objectR2);
        				objectBorderHitboxY = CreateRectangleHitboxY(((15-a)*12)+position-23, objectR1, objectR2);
     					break;
        			case '3':
        				objectR1 = 11;
        				objectR2 = 16;
        				objectBorderHitboxX = CreateRectangleHitboxX(30+26*j+12, objectR1, objectR2);
      					objectBorderHitboxY = CreateRectangleHitboxY(((15-a)*12)+position-17, objectR1, objectR2);
        				break;
        			case '4':
        				objectR1 = 9;
        				objectR2 = 14;
        				objectBorderHitboxX = CreateRectangleHitboxX(30+26*j+14, objectR1, objectR2);
        				objectBorderHitboxY = CreateRectangleHitboxY(((15-a)*12)+position-30, objectR1, objectR2);
        				break;
        			}
    				if(31+(a*12)+smallStep < 212-objectR2*2 && 31+(a*12)+smallStep > 19)
    				{
    					SetObstacle(m1.obstacles[i][j], 30+26*j, 31+(a*12)+smallStep);
    				}
    				else if (31+(a*12)+smallStep >= 212-objectR2*2) m1.obstacles[i][j] = '0';
        			if(Collision(s1.Hitbox_X, s1.Hitbox_Y, s1.centerWidth, s1.centerHeight, objectBorderHitboxX,
        							objectBorderHitboxY, objectR1, objectR2))
        			{
        				switch(m1.obstacles[i][j])
        				{
        				case '1':
        					s1.HP -= DMG.snowmanDMG;
        					break;
        				case '2':
        					s1.HP -= DMG.rockDMG;
        					break;
        				case '3':
        					s1.HP -= DMG.bowmanDMG;
        					break;
        				case '4':
        					s1.HP -= DMG.treeDMG;
        					break;
        				}
        				m1.obstacles[i][j] = '0';
        				//Sound(5);

        				if(s1.HP<0)
        				{
        					GameOver();
        					return;
        				}
        				else
        				{
        					UpdateHP(s1.HP);
        					s1.Y = 155;
        					s1.speed = 300;
        				}
        			}
        			free(objectBorderHitboxX);
        			free(objectBorderHitboxY);
        		}
        	}
        }

		if(BorderCollision(s1.Hitbox_X, s1.Hitbox_Y, s1.centerHeight, s1.centerWidth, leftBorderHitboxX, leftBorderHitboxY))
		{
			s1.HP -= DMG.borderDMG;
			//Sound(5);
			if(s1.HP<0)
			{
				GameOver();
				return;
			}
			else
			{
				UpdateHP(s1.HP);
				s1.X = 145;
				s1.Y = 155;
				s1.speed = 300;
			}
		}
		else if(BorderCollision(s1.Hitbox_X, s1.Hitbox_Y, s1.centerHeight, s1.centerWidth, rightBorderHitboxX, rightBorderHitboxY))
		{
			s1.HP -= DMG.borderDMG;
			//Sound(5);
			if(s1.HP<0)
			{
				GameOver();
				return;
			}
			else
			{
				UpdateHP(s1.HP);
				s1.X = 145;
				s1.Y = 155;
				s1.speed = 300;
			}
		}
		PositionUpdate(s1.speed, s1.X, s1.Y);
		s1.speed = SpeedUpdate(s1.speed);
		time += s1.speed;
		if(position%12==0)
		{
			arrow++;
			UpdateMiniMap(arrow);
		}

		free(s1.Hitbox_Y);
		free(s1.Hitbox_X);

		position += POSITION_UPDATE;
		smallStep++;
	}
}
