//--- DrawBox --- DONE
void DrawBox(uint16_t X, uint16_t Y, uint16_t width, uint16_t height, uint16_t border, uint16_t color)
{
	for(int i=0; i<border; i++)
	{
		ILI9341_drawLine(X, Y-i, X+(width-1), Y-i, color);
		ILI9341_drawLine(X+i, Y-border, X+i, Y-height+border+1, color);
		ILI9341_drawLine(X, Y-height+1+i, X+(width-1), Y-height+1+i, color);
		ILI9341_drawLine(X+(width-1)-i, Y-border, X+(width-1)-i, Y-height+border+1, color);
	}
}
