//--- UseMenu --- DONE
void UseMenu()
{
	int option=0;

	while(1)
	{
		if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_13) && option!=0)
		{
			//Sound(2);
			option--;
			ChangeTargetMenu(option, option+1);
		}
		else if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_14) && option!=2)
		{
			//Sound(2);
			option++;
			ChangeTargetMenu(option, option-1);
		}
		else if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_15))
		{
			//Sound(1);
			switch(option)
			{
				case 0:
					RunGame();
					DrawMenu(3);
					ILI9341_Fill_Rect(86, 151, 235, 190, 49149);
					DrawStartText(124, 161);
				break;
				case 1:
					DrawRanking();
					UseRanking();
				break;
				case 2:
					StartExitScreen();
					ILI9341_Fill(COLOR_BLACK);
					return;
				break;
			}
		}
	}
}
//--- ChangeTargetMenu --- DONE
void ChangeTargetMenu(uint8_t option, uint8_t LastOption)
{
	DrawMenu(LastOption);
	HAL_Delay(200);

	switch(option)
	{
		case 0:
		ILI9341_Fill_Rect(86, 151, 235, 190, 49149);
		DrawStartText(124, 161);
		break;
		case 1:
		ILI9341_Fill_Rect(86, 101, 235, 140, 49149);
		DrawRankingText(102, 111);
		break;
		case 2:
		ILI9341_Fill_Rect(86, 51, 235, 90, 49149);
		DrawExitText(107, 60);
		break;
	}
}
