char* ReadFromRanking()
{
	static char ranking[180];
	fresult = f_mount(&FatFs, "", 0);
	fresult = f_open(&file, "Ranking.txt", FA_READ);
	fresult = f_read(&file, buffer, 180, &bytes_read);
	sprintf(ranking, buffer);
	fresult = f_close(&file);
	return ranking;
}
