//--- PressStartButton --- DONE
void PressStartButton()
{
	while(1)
	{
		if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_15))
		{
			//Sound(2);
			break;
		}
	}
	PrintInfo(2);
}
//--- PressPauseButton --- DONE
void PressPauseButton()
{
	if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_15))
	{
		PrintInfo(1);
		//Sound(2);
		HAL_Delay(200);
		PressStartButton();
	}
}
