void UpdateHP(int HP)
{
	ILI9341_Fill_Rect(242,211,320,240,64203);
	switch(HP)
	{
	case 0:
		SetHeartGray(297,215);
		SetHeartGray(273,215);
		SetHeartGray(249,215);
		break;
	case 1:
		SetHeartRed(297,215);
		SetHeartGray(273,215);
		SetHeartGray(249,215);
		break;
	case 2:
		SetHeartRed(297,215);
		SetHeartRed(273,215);
		SetHeartGray(249,215);
		break;
	case 3:
		SetHeartRed(297,215);
		SetHeartRed(273,215);
		SetHeartRed(249,215);
		break;
	}
}
//--- SpeedUpdate --- DONE
int SpeedUpdate(int speed)
{
	if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_14) && speed<MAX_SPEED)
	{
		speed+=SPEED_UPDATE;
	}
	else if(HAL_GPIO_ReadPin(GPIOB, GPIO_PIN_13) && speed>MIN_SPEED)
	{
		speed-=SPEED_UPDATE;
	}
	return speed;
}
//--- CreateHitboxY --- DONE
int *CreateSquareHitboxY(int Y, int r)
{
	int size = r*8;
	int *tab = (int*)malloc(size*sizeof(int));

	int i=0;
	int j=r;

	for(; i<r*2+1; i++)
		tab[i]=Y+r;
	while(j!=0)
	{
    j--;
    tab[i]=Y+j;
		i++;
	}
	while(j!=r)
	{
		j++;
    tab[i]=Y-j;
		i++;
	}
	for(; i<r*6+1; i++)
		tab[i]=Y-r;
	while(j!=0)
	{
    j--;
    tab[i]=Y-j;
    i++;
	}
	while(j!=r)
	{
		j++;
    tab[i]=Y+j;
		i++;
	}
	return tab;
}
//--- CreateHitboxX --- DONE
int *CreateSquareHitboxX(int X, int r)
{
	int size = r*8;
	int *tab = (int*)malloc(size*sizeof(int));

	int i=0;
	int j=r;

	tab[i]=X-j;

	while(j!=0)
	{
		i++;
		j--;
		tab[i]=X-j;
	}
	while(j!=r)
	{
		i++;
		j++;
		tab[i]=X+j;
	}
	i++;
	for(; i<r*4+1; i++)
		tab[i]=X+r;
	while(j!=0)
	{
		j--;
    tab[i]=X+j;
    i++;
	}
	while(j!=r)
	{
		j++;
    tab[i]=X-j;
		i++;
	}
	for(; i<r*8; i++)
		tab[i]=X-r;

  return tab;
}
//--- Collision --- DONE
int Collision(int *X1, int *Y1, int r1a, int r1b, int *X2, int *Y2, int r2a, int r2b)
{
  int h1 = r1a*4+r1b*4;
  int h2 = r2a*4+r2b*4;

  int checkX = 0;
  int checkY = 0;

  for(int i=0; i<h1; i++)
  {
	  for(int j=0; j<h2; j++)
	  {
		  if(X1[i]==X2[j]) checkX = 1;
		  if(Y1[i]==Y2[j]) checkY = 1;
		  if(checkX == 1 && checkY == 1) return 1;
	  }
  }
  return 0;
}
