//--- BorderCollision --- DONE
int BorderCollision(int *X1, int *Y1, int r1a, int r1b, int *X2, int *Y2)
{
	int h1 = r1a*4+r1b*4;

	int checkX = 0, checkY = 0;

	for(int i=0; i<h1; i++)
	{
	    for(int j=0; j<h1; j++)
	    {
	    	if(X1[i]==X2[j]) checkX = 1;
	    	if(Y1[i]==Y2[j]) checkY = 1;
	    	if(checkX==1 && checkY ==1) return 1;
	    }
	}
	return 0;
}
//--- MetaCollision --- DONE
int MetaCollision(int *X1, int *Y1, int r1a, int r1b, int *X2, int *Y2)
{
	int h1 = r1a*4+r1b*4;
	int checkX = 0;
	int checkY = 0;

	for(int i=0; i<h1; i++)
	{
		for(int j=20; j<300; j++)
		{
			if(X1[i]==X2[j]) checkX = 1;
			if(Y1[i]==Y2[j]) checkY = 1;
			if(checkX==1 && checkY==1) return 1;
		}
	}
	return 0;
}
