//--- UpdateSpeedValue --- DONE
void UpdateSpeedValue(int speed)
{
	int SpeedInKm;

	if(speed!=0) SpeedInKm = round(2970/speed);
	else SpeedInKm = 0;

	ILI9341_Fill_Rect(163,212,242,240,29614);

	if(speed!=0)
	{
		char speed2[2];
		sprintf(speed2, "%d", SpeedInKm);
		SetChar12(speed2[0], 227, 219);
		SetChar12(speed2[1], 216, 219);
	}
	else
	{
		SetChar12('0', 215, 219);
	}
	DrawKmph(172,216);
}
//--- SetObstacle --- DONE
void SetObstacle(int obs, int X, int Y)
{
	switch(obs)
	{
	case '1':
		SetSnowman(X, Y);
		break;
	case '2':
		SetRock(X, Y);
		break;
	case '3':
		SetBowman(X, Y);
		break;
	case '4':
		SetTree(X, Y);
		break;
	}
}
